package day9;

public class TypeCastDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a =200;
		double d=a;
		System.out.println("implicit casting" + d);
		double d1=200.89;
		int b=(int) d1;
		System.out.println("explicit casting" + b);
		

	}

}
